import Link from "next/link";
import Typography from "@material-ui/core/Typography";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles({
  wrapper: {
    display: "flex",
    alignItems: "flex-start",
    flexWrap: "nowrap",
    height: "100%",
  },
  item: {
    flexGrow: 1,
  },

  link: {
    color: "#8e7329",
  },
});

export default function Sections() {
  const classes = useStyles();
  return (
    <div className={classes.wrapper}>
      <Link href="/sale">
        <a className={classes.item}>
          <Typography className={classes.link}>Sale</Typography>
        </a>
      </Link>
      <Link href="/sympathy">
        <a className={classes.item}>
          <Typography className={classes.link}>Sympathy</Typography>
        </a>
      </Link>
      <Link href="/gifts">
        <a className={classes.item}>
          <Typography className={classes.link}>Gifts</Typography>
        </a>
      </Link>
      <Link href="/plants">
        <a className={classes.item}>
          <Typography className={classes.link}>Plants</Typography>
        </a>
      </Link>
      <Link href="/birthday">
        <a className={classes.item}>
          {" "}
          <Typography className={classes.link}>Birthday</Typography>
        </a>
      </Link>
      <Link href="/samedaydelivery">
        <a className={classes.item}>
          <Typography className={classes.link}>Same Day Delivery</Typography>
        </a>
      </Link>
    </div>
  );
}
